import './App.css';
import axios from 'axios';
import { useState, useEffect } from 'react';

function App() {
  const [itemss, setitemss] = useState([]); 
  const [newitems, setNewitems] = useState({ name: "", age: "", mobileno: "", city: "" }); 
  const [editingitems, setEditingitems] = useState(null); 

  useEffect(() => {
    fetchitemss(); 
  }, []);

  const fetchitemss = async () => {
    try {
      const { data } = await axios.get(`http://localhost:5050/datas`);
      setitemss(data);
    } catch (error) {
      console.error("Error fetching itemss:", error);
    }
  };

  const handleCreate = async () => {
    try {
      await axios.post(`http://localhost:5050/datas`, newitems);
      setNewitems({ name: "", age: "", mobileno: "", city: "" });
      fetchitemss(); 
    } catch (error) {
      console.error("Error creating items:", error);
    }
  };

  const handleUpdate = async (id) => {
    try {
      await axios.put(`http://localhost:5050/datas/${id}`, editingitems);
      setEditingitems(null);
      fetchitemss();
    } catch (error) {
      console.error("Error updating items:", error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:5050/datas/${id}`);
      fetchitemss(); 
    } catch (error) {
      console.error("Error deleting items:", error);
    }
  };

  return (
    <>
      <div className="container">
        <div className="operations">
          <h3>CRUD Operations</h3>

          <div className="inputs">
            <input
              type="text"
              placeholder="Name"
              value={newitems.name}
              onChange={(e) => setNewitems({ ...newitems, name: e.target.value })}
            />
            <input
              type="text"
              placeholder="Age"
              value={newitems.age}
              onChange={(e) => setNewitems({ ...newitems, age: e.target.value })}
            />
            <input
              type="text"
              placeholder="Mobile Number"
              value={newitems.mobileno}
              onChange={(e) => setNewitems({ ...newitems, mobileno: e.target.value })}
            />
            <input
              type="text"
              placeholder="City"
              value={newitems.city}
              onChange={(e) => setNewitems({ ...newitems, city: e.target.value })}
            />
            <button className="btn-green" onClick={handleCreate}>Add</button>
          </div>

          <div className="table">
            <table>
              <thead>
                <tr>
                  <th>S.No</th>
                  <th>Name</th>
                  <th>Age</th>
                  <th>Mobile Number</th>
                  <th>City</th>
                  <th>Edit</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>
                {itemss.map((items, index) => (
                  <tr key={items._id}>
                    <td>{index + 1}</td>
                    <td>
                      {editingitems?._id === items._id ? (
                        <input
                          type="text"
                          value={editingitems.name}
                          onChange={(e) =>
                            setEditingitems({ ...editingitems, name: e.target.value })
                          }
                        />
                      ) : (
                        items.name
                      )}
                    </td>
                    <td>
                      {editingitems?._id === items._id ? (
                        <input
                          type="text"
                          value={editingitems.age}
                          onChange={(e) =>
                            setEditingitems({ ...editingitems, age: e.target.value })
                          }
                        />
                      ) : (
                        items.age
                      )}
                    </td>
                    <td>
                      {editingitems?._id === items._id ? (
                        <input
                          type="text"
                          value={editingitems.mobileno}
                          onChange={(e) =>
                            setEditingitems({ ...editingitems, mobileno: e.target.value })
                          }
                        />
                      ) : (
                        items.mobileno
                      )}
                    </td>
                    <td>
                      {editingitems?._id === items._id ? (
                        <input
                          type="text"
                          value={editingitems.city}
                          onChange={(e) =>
                            setEditingitems({ ...editingitems, city: e.target.value })
                          }
                        />
                      ) : (
                        items.city
                      )}
                    </td>
                    <td>
                      {editingitems?._id === items._id ? (
                        <button
                          className="btn-green"
                          onClick={() => handleUpdate(items._id)}
                        >
                          Save
                        </button>
                      ) : (
                        <button
                          className="btn-green"
                          onClick={() => setEditingitems(items)}
                        >
                          Edit
                        </button>
                      )}
                    </td>
                    <td>
                      <button
                        className="btn-red"
                        onClick={() => handleDelete(items._id)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
